// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract PropertyRental {
    // Struct to store property details
    struct Property {
        uint id;
        address owner;
        string name;
        uint256 pricePerDay;
        bool isAvailable;
    }

    // Enum for user roles
    enum UserRole { Unregistered, Owner, Renter }

    // Mapping to store user roles
    mapping(address => UserRole) public userRoles;

    // Mapping of property IDs to Property structs
    mapping(uint => Property) public properties;

    // Mapping of renters to their rented properties
    mapping(address => uint) public rentedProperties;

    // Modifier to check if the caller is an owner
    modifier onlyOwner() {
        require(userRoles[msg.sender] == UserRole.Owner, "Caller is not an owner");
        _;
    }

    // Modifier to check if the caller is a renter
    modifier onlyRenter() {
        require(userRoles[msg.sender] == UserRole.Renter, "Caller is not a renter");
        _;
    }

    // Modifier to check if caller owns a specific property
    modifier isPropertyOwner(uint propertyId) {
        require(properties[propertyId].owner == msg.sender, "Not the owner of this property");
        _;
    }

    // Modifier to ensure a property is available
    modifier isAvailable(uint propertyId) {
        require(properties[propertyId].isAvailable, "Property not available");
        _;
    }

    // Event emitted when a property is rented
    event PropertyRented(uint propertyId, address renter);

    uint public nextPropertyId;

    // Function to register as a property owner
    function registerAsOwner() public {
        userRoles[msg.sender] = UserRole.Owner;
    }

    // Function to register as a renter
    function registerAsRenter() public {
        userRoles[msg.sender] = UserRole.Renter;
    }

    // Function to add a property (only for owners)
    function addProperty(string memory name, uint256 pricePerDay) public onlyOwner {
        properties[nextPropertyId] = Property({
            id: nextPropertyId,
            owner: msg.sender,
            name: name,
            pricePerDay: pricePerDay,
            isAvailable: true
        });
        nextPropertyId++;
    }

    // Function to rent a property (only for renters)
    function rentProperty(uint propertyId) public payable onlyRenter isAvailable(propertyId) {
        Property storage property = properties[propertyId];
        require(msg.value == property.pricePerDay, "Incorrect payment amount");

        property.isAvailable = false;
        rentedProperties[msg.sender] = propertyId;

        emit PropertyRented(propertyId, msg.sender);
    }

    // Function to return a property (only for property owners)
    function returnProperty(uint propertyId) public isPropertyOwner(propertyId) {
        Property storage property = properties[propertyId];
        property.isAvailable = true;
    }
}
